import React from 'react';
import { CalcDisplay } from './calc_display/CalcDispaly';
import s from './Calculator.module.scss'
import { CalcCountBut } from './calc_count_but/CalcCountBut';
import { CalcOperation } from './calc_operation_but/CalcOperation';
import { CalcEqual } from './calc_equal/CalcEqual';
import { CalcConstructor } from './calc_constructor/CalcConstructor';
import eye from '../assets/eye_black.svg';
import vector from '../assets/Vector_black.svg'

export const Calculator = () => {
    return (
        <div className={s.calculator_app}>
            <div className={s.side_bar}>
                <CalcDisplay />
                <CalcCountBut />
                <CalcOperation />
                <CalcEqual />
            </div>
            <div className={s.calc_constructor}>
                <div className={s.change_mode_wrapper}>
                    <div className={s.mode_run_time}>
                        <img src={eye} alt="" />
                    </div>
                    <div className={s.mode_constructor}>
                        <img src={vector} alt="" />
                    </div>
                </div>
                <CalcConstructor />
            </div>
        </div>

    );
}
